import LoginBoxPresenter from "../Presenter/LoginBoxPresenter";
import LoginBoxTitleContainer from "./LoginBoxTitleContainer";
import { Form, Button } from "react-bootstrap";
import 'bootstrap/dist/css/bootstrap.min.css';
import styled from "styled-components";
import { useState } from "react";

const FromGroup = styled(Form.Control)`
    width: 400px;
`


const LoginBoxContainer = () => {
    const [ID, setID] = useState('');
    const [PW, setPW] = useState('')

    const LoginButtonClick = () => {
        setID()
    }

    return (
        <LoginBoxPresenter>
            <LoginBoxTitleContainer />
            <Form>
                <Form.Group className="mb-3" controlId="formBasicEmail">
                    <Form.Label>Email address</Form.Label>
                    <FromGroup type="email" placeholder="Enter email" onchange={(e) => setID(e.target.value)} />
                </Form.Group>

                <Form.Group className="mb-3" controlId="formBasicPassword">
                    <Form.Label>Password</Form.Label>
                    <FromGroup type="password" placeholder="Password" />
                </Form.Group>
                <Button variant="primary" type="submit" onclick={LoginButtonClick}>
                    Submit
                </Button>
            </Form>
        </LoginBoxPresenter>
    )
}

export default LoginBoxContainer;
